import axios from 'axios';


  export const fetchStreams = async () => {
    return new Promise((resolve) => {
      setTimeout(() => {
        try {
          axios.get('http://localhost:8080/twitch').then((res) => {
            resolve(res.data);
          });
        } catch(err) { console.log(err); }
      }, 1100);
    });
  }
